 School has developed a type of ionic spiderweb that is able to imitate 
dual functions found with real spiderwebs. In their paper published in 
the journal <i class="">Science Robotics</i>, the group describes their spiderwebs and possible uses for them.

                                         
                                                  </p><section class="ads-336x280 article-banner first-banner">
         
        <div id="div-gpt-ad-1449240174198-2" data-google-query-id="CM2fnt2U6-oCFYDhuwgdZe0A8A" class="">
        
        <div id="google_ads_iframe_/4988204/Phys_Story_InText_Box_0__container__" style="border: 0pt none;" class=""><iframe id="google_ads_iframe_/4988204/Phys_Story_InText_Box_0" title="3rd party ad content" name="google_ads_iframe_/4988204/Phys_Story_InText_Box_0" scrolling="no" marginwidth="0" marginheight="0" style="border-width: 0px; border-style: none; vertical-align: bottom;" data-google-container-id="1" data-load-complete="true" width="300" height="250" frameborder="0" class=""></iframe></div></div>
      </section><p class="">When
 spiders make their webs, they are careful to use the minimum amount of 
material. Prior research has shown that excess webbing collects 
extraneous material, which results in the web becoming messy and less 
effective. With minimal material webs, spiders wait for prey to adhere 
to the strands (they can feel the web vibrating), then rush over and add
 more binding material before their meal can escape. This approach helps
 to keep a cleaner more efficient web. </p><p class="">In this new effort, the researchers sought to replicate this approach
 using stretchable nylon to make an ionic spiderweb. Their goal was to 
expand the range of soft robotics tools available to engineers. Prior 
research has shown that robots designed to use electrostatics as a means
 of gently grabbing or sensing, including capacitive tactile sensors, 
dielectric elastomer actuators and adhesion grippers, can become 
overburdened with undesired material in ways similar to <a href="https://phys.org/tags/spider+webs/" rel="tag" class="textTag">spider webs</a>.
 To replicate the duality of catchability and cleanliness, the 
researchers constructed webs using just a single pair of ionic threads. 
Their electrostatic properties allowed them to be used as capturing 
material, while their minimalism kept them free from undesired material.
 The threads were made using organogel that was encapsulated with <a href="https://phys.org/tags/silicone+rubber/" rel="tag" class="textTag">silicone rubber</a> and formed in strand shapes.</p></body></html>', null, null, '2020-07-26 14:50:01', '2020-08-18 10:47:34', '2020-08-18 10:47:34', null, null, null, null, null, 0, 1, null);
