INSERT INTO tickets (id, from_entity_id, from_entity_type, to_entity_id, to_entity_type, from_company_user_id, contact_company_user_id, to_company_user_id, to_team_id, to_product_id, priority_id, status_id, due_date, name, description, connection_details, access_details, created_at, updated_at, deleted_at, availability, replicated_to_entity_id, replicated_to_entity_type, category_id, parent_id, is_spam, sequence, merge_comment) VALUES (54, 166, 'App\\Client', 9, 'App\\Company', 234, null, 24, 9, 14, 2, 2, null, 'Test ticket from ATest company 2', '<html><head><meta http-equiv="Content-Type" content="text/html; charset=utf-8"></head><body style="word-wrap: break-word; -webkit-nbsp-mode: space; line-break: after-white-space;" class="">Email text: testing email to ticket&nbsp;<div class=""><br class=""></div><div class=""><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px; font-variant-ligatures: normal; orphans: 2; widows: 2; background-color: rgb(255, 255, 255);" class="">Tiny invertebrates called ''</span><b style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px; font-variant-ligatures: normal; orphans: 2; widows: 2; background-color: rgb(255, 255, 255);" class="">water bears</b><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px; font-variant-ligatures: normal; orphans: 2; widows: 2; background-color: rgb(255, 255, 255);" class="">'' can survive in the vacuum of space, a European Space Agency experiment has shown. They are the first animals known to be able to survive the harsh combination of low pressure and intense radiation found in space.</span></div><div class=""><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px; font-variant-ligatures: normal; orphans: 2; widows: 2; background-color: rgb(255, 255, 255);" class=""><div style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class="">Water bears, also known as tardigrades, are known for their&nbsp;<a href="https://www.newscientist.com/article/mg16422095-100-indestructible" style="box-sizing: border-box; font-family: inherit; text-decoration: none; color: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;" class="">virtual indestructibility</a>&nbsp;on Earth. The creatures can survive intense pressures, huge doses of radiation, and years of being dried out.</div><div style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class="">To further test their hardiness, Ingemar Jönsson of Sweden’s Kristianstad University and colleagues&nbsp;<a href="https://www.newscientist.com/blog/space/2007/09/water-bears-in-space/" style="box-sizing: border-box; font-family: inherit; text-decoration: none; color: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;" class="">launched</a>&nbsp;two species of dried-up tardigrades from Kazakhstan in September 2007 aboard ESA’s FOTON-M3 mission, which carried a variety of experimental payloads.</div><p style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class=""></p><div id="video-mid-article" class="mpu" data-google-query-id="CPDU3Zz9kOsCFQ_auwgd4TgJPw" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: &quot;PT Serif&quot;, Georgia, serif; vertical-align: baseline; display: inline; position: absolute; bottom: 0px; right: 0px; color: rgb(0, 0, 0); font-variant-ligatures: normal;"><div id="google_ads_iframe_/21632812681/NewScientist/Article-mid-editorial-video_0__container__" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0pt none; font-family: inherit; vertical-align: baseline;" class=""><iframe id="google_ads_iframe_/21632812681/NewScientist/Article-mid-editorial-video_0" title="3rd party ad content" name="google_ads_iframe_/21632812681/NewScientist/Article-mid-editorial-video_0" width="1" height="1" scrolling="no" marginwidth="0" marginheight="0" frameborder="0" data-google-container-id="4" data-load-complete="true" style="box-sizing: inherit; margin: 0px; padding: 0px; border-width: 0px; font-family: inherit; vertical-align: bottom; width: 1px !important; height: 1px !important;" class=""></iframe></div></div><p style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class=""></p><div style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class="">After 10 days of exposure to space, the satellite returned to Earth. The tardigrades were retrieved and rehydrated to test how they reacted to the airless conditions in space, as well as ultraviolet radiation from the Sun and charged particles from space called cosmic rays.</div><div style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class="">The vacuum itself seemed to have little effect on the creatures. But ultraviolet radiation, which can damage cellular material and DNA, did take its toll.</div><h2 style="box-sizing: border-box; font-size: 16px; margin: 0px 0px 0.93747rem; padding: 0px; border: 0px; font-family: &quot;Titillium Web&quot;, Helvetica, &quot;Trebuchet MS&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: -0.0375rem; font-variant-ligatures: normal;" class="">Dried out</h2><div style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class="">In one of the two species tested, 68% of specimens that were shielded from higher-energy radiation from the Sun were revived within 30 minutes of being rehydrated. Many of these tardigrades went on to lay eggs that successfully hatched.</div><div style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class="">But only a handful of animals survived full exposure to the Sun’s UV light, which is more than 1000 times stronger in space than on the Earth’s surface.</div><div style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class="">Before this experiment, only&nbsp;<a href="https://www.newscientist.com/article/dn8297-hardy-lichen-shown-to-survive-in-space" style="box-sizing: border-box; font-family: inherit; text-decoration: none; color: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;" class="">lichen</a>&nbsp;and bacteria were known to be able to survive exposure to the combination of vacuum and space radiation.</div><span style="box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-variant-ligatures: normal;" class=""><br style="box-sizing: inherit;" class=""><br style="box-sizing: inherit;" class="">Read more:&nbsp;<a href="https://www.newscientist.com/article/dn14690-water-bears-are-first-animal-to-survive-space-vacuum/#ixzz6UjNMnd9p" style="box-sizing: border-box; font-family: inherit; text-decoration: none; color: rgb(0, 51, 153); margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;" class="">https://www.newscientist.com/article/dn14690-water-bears-are-first-animal-to-survive-space-vacuum/#ixzz6UjNMnd9p</a></span></span></div></body></html>', null, null, '2020-08-10 15:46:02', '2020-08-18 10:52:53', '2020-08-18 10:52:53', null, null, null, null, null, 0, 3, null);
