sse 60</font></span></div><div class=""><span style="font-family: arial, sans-serif; font-variant-ligatures: normal; orphans: 2; widows: 2;" class=""><font color="#5c0600" class="">8050 Zürich</font></span><br class=""><br class="">The information contained in&nbsp;this email may be confidential&nbsp;and legally privileged. It is&nbsp;intended solely for the&nbsp;addressee and access by&nbsp;anyone else is unauthorised. If&nbsp;you are not the intended&nbsp;recipient, any disclosure,&nbsp;copying, distribution or any&nbsp;action taken or not taken in&nbsp;reliance on this email, is&nbsp;prohibited and may be&nbsp;unlawful; please delete this&nbsp;email and kindly inform us.</div><div class=""><br class=""></div></div></div></div></div></div><br class=""></div></div></div><br class=""></body></html>', null, null, '2020-11-10 18:00:07', '2020-11-13 14:48:01', null, null, null, null, null, null, 0, 2, null);
